import React from 'react'

export const Footer = () => {
  return (
    <footer class="section">
    <div class="contact-links" id="contact">
      <a class="menu-item" href="mailto:jaywen89@gmail.com">Email</a>
      <a class="menu-item"  href="https://www.linkedin.com/in/jay-wen/">LinkedIn</a>
    </div>
    <p class="footer-copy">Copyright &copy; Jay Wen Studio <span id="year"></span> All Rights Reserved</p>
  </footer>
  )
}
